  \"Proposed North Dakota Wildlife Management Area: Grassland Easement Program Environmental
  Assessment\",\n\t\"tracking_summary\": {\n\t\t\"total\": 9,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:57.361422\",\n\t\"name\":
  \"proposed-north-dakota-wildlife-management-area-grassland-easement-program-environmental-as\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The focus for this project will primarily
  be on high quality grasslands not only for waterfowl, but also for the myriad of
  other bird species, plants, and mammals that rely on this habitat, as well as the
  overall protection of the critically declining mixed-grass prairie ecosystem. In
  order to do this, the Service plans to establish an easement program under the National
  Wildlife Refuge System (System) called the North Dakota Wildlife Management Area
  (WMA). A conservation easement program was chosen because it is generally more efficient
  and effective to protect areas of remaining high quality habitat than to restore
  areas of degraded habitat. Furthermore, since over 95 percent of the Missouri Coteau
  is privately owned, success will require cooperation with landowners. Fortunately,
  many of the current land management practices, i.e. grazing, are compatible with
  the goals of this project.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
